import { connect } from 'react-redux';
import Item from './Item';
class ItemList extends Component {
  render() {
    return (
      <div>
          <h1>Item List </h1>
          <Item/>
      </div>
    )
  } 
}
export default ItemList;

ItemList.propTypes = {
    games: React.PropTypes.array.isRequired
  }
